void OAITasksApi::v2TasksJsonGetCallback(OAIHttpRequestWorker *worker) {
    QString error_str = worker->error_str;
    QNetworkReply::NetworkError error_type = worker->error_type;

    if (worker->error_type != QNetworkReply::NoError) {
        error_str = QString("%1, %2").arg(worker->error_str, QString(worker->response));
    }
    QList<OAITask> output;
    QString json(worker->response);
    QByteArray array(json.toStdString().c_str());
    QJsonDocument doc = QJsonDocument::fromJson(array);
    QJsonArray jsonArray = doc.array();
    for (QJsonValue obj : jsonArray) {
        OAITask val;
        ::OpenAPI::fromJsonValue(val, obj);
        output.append(val);
    }
    worker->deleteLater();

    if (worker->error_type == QNetworkReply::NoError) {
        Q_EMIT v2TasksJsonGetSignal(output);
        Q_EMIT v2TasksJsonGetSignalFull(worker, output);
    } else {

#if defined(_MSC_VER)
// For MSVC
#pragma warning(push)
#pragma warning(disable : 4996)
#elif defined(__clang__)
// For Clang
#pragma clang diagnostic push
#pragma clang diagnostic ignored "-Wdeprecated-declarations"
#elif defined(__GNUC__)
// For GCC
#pragma GCC diagnostic push
#pragma GCC diagnostic ignored "-Wdeprecated-declarations"
#endif

        Q_EMIT v2TasksJsonGetSignalE(output, error_type, error_str);
        Q_EMIT v2TasksJsonGetSignalEFull(worker, error_type, error_str);

#if defined(_MSC_VER)
#pragma warning(pop)
#elif defined(__clang__)
#pragma clang diagnostic pop
#elif defined(__GNUC__)
#pragma GCC diagnostic pop
#endif

        Q_EMIT v2TasksJsonGetSignalError(output, error_type, error_str);
        Q_EMIT v2TasksJsonGetSignalErrorFull(worker, error_type, error_str);
    }
}

void OAITasksApi::v2TasksJsonPost(const QString &current_state, const QString &due_date, const QString &person_id, const QString &subject, const QString &task_type, const qint32 &user_id, const ::OpenAPI::OptionalParam<QString> &description, const ::OpenAPI::OptionalParam<QString> &idempotency_key, const ::OpenAPI::OptionalParam<QString> &remind_at) {
    QString fullPath = QString(_serverConfigs["v2TasksJsonPost"][_serverIndices.value("v2TasksJsonPost")].URL()+"/v2/tasks.json");
    
    OAIHttpRequestWorker *worker = new OAIHttpRequestWorker(this, _manager);
    worker->setTimeOut(_timeOut);
    worker->setWorkingDirectory(_workingDirectory);
    OAIHttpRequestInput input(fullPath, "POST");

    
    {
        input.add_var("current_state", ::OpenAPI::toStringValue(current_state));
    }
    if (description.hasValue())
    {
        input.add_var("description", ::OpenAPI::toStringValue(description.value()));
    }
    
    {
        input.add_var("due_date", ::OpenAPI::toStringValue(due_date));
    }
    if (idempotency_key.hasValue())
    {
        input.add_var("idempotency_key", ::OpenAPI::toStringValue(idempotency_key.value()));
    }
    
    {
        input.add_var("person_id", ::OpenAPI::toStringValue(person_id));
    }
    if (remind_at.hasValue())
    {
        input.add_var("remind_at", ::OpenAPI::toStringValue(remind_at.value()));
    }
    
    {
        input.add_var("subject", ::OpenAPI::toStringValue(subject));
    }
    
    {
        input.add_var("task_type", ::OpenAPI::toStringValue(task_type));
    }
    
    {
        input.add_var("user_id", ::OpenAPI::toStringValue(user_id));
    }

    for (auto keyValueIt = _defaultHeaders.keyValueBegin(); keyValueIt != _defaultHeaders.keyValueEnd(); keyValueIt++) {
        input.headers.insert(keyValueIt->first, keyValueIt->second);
    }


    connect(worker, &OAIHttpRequestWorker::on_execution_finished, this, &OAITasksApi::v2TasksJsonPostCallback);
    connect(this, &OAITasksApi::abortRequestsSignal, worker, &QObject::deleteLater);
    connect(worker, &QObject::destroyed, this, [this]() {
        if (findChildren<OAIHttpRequestWorker*>().count() == 0) {
            Q_EMIT allPendingRequestsCompleted();
        }
    });

    worker->execute(&input);
}

